Actionscript.script:
function 攻击时移动(慢速度, 快速度)
{
   if(_parent.方向 == "右")
   {
      if(Key.isDown(_parent.右键) == true)
      {
         _parent.移动("右",快速度);
      }
      else
      {
         _parent.移动("右",慢速度);
      }
   }
   else if(_parent.方向 == "左")
   {
      if(Key.isDown(_parent.左键) == true)
      {
         _parent.移动("左",快速度);
      }
      else
      {
         _parent.移动("左",慢速度);
      }
   }
}
function 攻击时可改变移动方向(速度)
{
   if(Key.isDown(_parent.右键) == true)
   {
      _parent.方向改变("右");
   }
   else if(Key.isDown(_parent.左键) == true)
   {
      _parent.方向改变("左");
   }
   if(_parent.方向 == "右")
   {
      _parent.移动("右",速度);
   }
   else if(_parent.方向 == "左")
   {
      _parent.移动("左",速度);
   }
}
