onClipEvent(load){
   声音 = "";
   霰弹值 = 1;
   子弹散射度 = 0;
   发射效果 = "";
   子弹种类 = "近战子弹";
   var temp = 1;
   if(_root.刀 == "匕首")
   {
      temp = 10;
   }
   if(_root.刀 == "大剑")
   {
      temp = 2.5;
   }
   if(_root.刀 == "短棒")
   {
      temp = 4;
   }
   if(_root.刀 == "水管")
   {
      temp = 6;
   }
   if(_root.刀 == "棒球棒")
   {
      temp = 3;
   }
   if(_root.刀 == "破旧军刀")
   {
      temp = 4;
   }
   if(_root.刀 == "光刃摩羯")
   {
      temp = 8;
   }
   if(_root.刀 == "光剑天秤")
   {
      temp = 4;
   }
   if(_root.刀 == "战术狗腿刀")
   {
      temp = 4;
   }
   if(_root.刀 == "金蛇剑")
   {
      temp = 3;
   }
   if(_root.刀 == "秋月")
   {
      temp = 4;
   }
   if(_root.刀 == "虎彻")
   {
      temp = 6;
   }
   if(_root.刀 == "镜之虎彻")
   {
      temp = 8;
   }
   if(_root.刀 == "饮血野太刀")
   {
      temp = 3;
   }
   子弹威力 = _parent._parent.空手攻击力 / 3 * (1 + _parent._parent.技能等级 * 1 * temp) + _parent._parent.刀属性.power + _parent._parent.mp * 1.8;
   子弹速度 = 0;
   击中地图效果 = "";
   Z轴攻击范围 = 30;
   击倒率 = 10;
   击中后子弹的效果 = "空手攻击火花";
   if(_parent._parent.是否为敌人 == true)
   {
      子弹敌我属性 = false;
   }
   else
   {
      子弹敌我属性 = true;
   }
   i = 1;
   while(i <= 3)
   {
      if(_parent.刀.刀.装扮["刀口位置" + i]._x != undefined)
      {
         var myPoint = {x:_parent.刀.刀.装扮["刀口位置" + i]._x,y:_parent.刀.刀.装扮["刀口位置" + i]._y};
         _parent.刀.刀.装扮.localToGlobal(myPoint);
         if(myPoint.y == _parent.刀.刀.装扮["刀口位置" + i]._y)
         {
            _parent.动画完毕();
         }
         _root.gameworld.globalToLocal(myPoint);
         shootX = myPoint.x;
         shootY = myPoint.y;
         _root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,shootX,shootY,_parent._parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果);
      }
      i++;
   }
}

