   }
   if(_root.刀 == "虎彻")
   {
      temp = 3;
   }
   if(_root.刀 == "秋月")
   {
      temp = 5;
   }
   if(_root.刀 == "金蛇剑")
   {
      temp = 3;
   }
   if(_parent._parent.刀属性.power != undefined && _parent._parent.刀属性.power != NaN)
   {
      子弹威力 = _parent._parent.空手攻击力 / 2 * (1 + _parent._parent.技能等级 * 1 * temp) + _parent._parent.刀属性.power + _parent._parent.mp * 2;
   }
   else
   {
      if(_root.手部装备 == "褐色道钉手套")
      {
         temp = 3;
      }
      子弹威力 = _parent._parent.空手攻击力 * (1 + _parent._parent.技能等级 * 1 * temp) + 1 + _parent._parent.mp / 2;
   }
   子弹速度 = 0;
   击中地图效果 = "";
   Z轴攻击范围 = 30;
   击倒率 = 1;
   击中后子弹的效果 = "空手攻击火花";
   if(_parent._parent.是否为敌人 == true)
   {
      子弹敌我属性 = false;
   }
   else
   {
      子弹敌我属性 = true;
   }
   var myPoint = {x:this._x,y:this._y};
   _parent.localToGlobal(myPoint);
   _root.gameworld.globalToLocal(myPoint);
   shootX = myPoint.x;
   shootY = myPoint.y;
   _root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,shootX,shootY,_parent._parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果);
