}
onClipEvent(load){
   if(Key.isDown(_parent._parent.上键))
   {
      _parent.上下跳移动方向 = "上";
      _parent.gotoAndPlay("上下闪现");
   }
   else if(Key.isDown(_parent._parent.下键))
   {
      _parent.上下跳移动方向 = "下";
      _parent.gotoAndPlay("上下闪现");
   }
   if(_parent._parent.方向 == "右")
   {
      if(Key.isDown(_parent._parent.右键) == true)
      {
         _parent.gotoAndPlay("前闪现");
      }
   }
   else if(_parent._parent.方向 == "左")
   {
      if(Key.isDown(_parent._parent.左键) == true)
      {
         _parent.gotoAndPlay("前闪现");
      }
   }
}

onClipEvent(enterFrame){
   _parent._parent.移动(_parent.上下跳移动方向,25 * (1 + Number(_parent._parent.技能等级) / 5));
}

onClipEvent(enterFrame){
   _parent.攻击时移动(40 * (1 + Number(_parent._parent.技能等级) / 5),40 * (1 + Number(_parent._parent.技能等级) / 5));
}

onClipEvent(load){
   声音 = "";
   霰弹值 = 1;
   子弹散射度 = 0;
   发射效果 = "";
   子弹种类 = "近战子弹";
   var temp = 1;
   if(_root.刀 == "青萍元气剑")
   {
      temp = 6;
   }
   if(_root.刀 == "黑铁的剑")
   {
      temp = 6;
   }
   if(_root.刀 == "中国战刀")
   {
      temp = 10;
   }
   if(_root.刀 == "金蛇剑")
   {
      temp = 3;
   }
   子弹威力 = _parent._parent.空手攻击力 / 3 * (1 + _parent._parent.技能等级 * 1 * temp) + _parent._parent.刀属性.power + _parent._parent.hp;
   子弹速度 = 0;
   击中地图效果 = "";
   Z轴攻击范围 = 30;
   击倒率 = 10;
   击中后子弹的效果 = "空手攻击火花";
   if(_parent._parent.是否为敌人 == true)
   {
      子弹敌我属性 = false;
   }
   else
   {
      子弹敌我属性 = true;
   }
   i = 1;
   while(i <= 3)
   {
      if(_parent.刀.刀.装扮["刀口位置" + i]._x != undefined)
      {
         var myPoint = {x:_parent.刀.刀.装扮["刀口位置" + i]._x,y:_parent.刀.刀.装扮["刀口位置" + i]._y};
         _parent.刀.刀.装扮.localToGlobal(myPoint);
         if(myPoint.y == _parent.刀.刀.装扮["刀口位置" + i]._y)
         {
            _parent.动画完毕();
         }
         _root.gameworld.globalToLocal(myPoint);
         shootX = myPoint.x;
         shootY = myPoint.y;
         _root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,shootX,shootY,_parent._parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果);
      }
      i++;
   }
}

